#ifndef CSR_NO_SHOW_IMPL 
void cap_prd_csr_int_intf_int_enable_clear_t::show() {
    PLOG_MSG(get_hier_path() << "(all) : 0x" << hex << all() << dec << endl);
    if(all() == 0) return;

    PLOG_MSG(hex << string(get_hier_path()) << ".ps_pkt_err_enable: 0x" << int_var__ps_pkt_err_enable << dec << endl);
    PLOG_MSG(hex << string(get_hier_path()) << ".ps_pkt_sop_err_enable: 0x" << int_var__ps_pkt_sop_err_enable << dec << endl);
    PLOG_MSG(hex << string(get_hier_path()) << ".ps_pkt_eop_err_enable: 0x" << int_var__ps_pkt_eop_err_enable << dec << endl);
    PLOG_MSG(hex << string(get_hier_path()) << ".ps_resub_pkt_err_enable: 0x" << int_var__ps_resub_pkt_err_enable << dec << endl);
    PLOG_MSG(hex << string(get_hier_path()) << ".ps_resub_pkt_sop_err_enable: 0x" << int_var__ps_resub_pkt_sop_err_enable << dec << endl);
    PLOG_MSG(hex << string(get_hier_path()) << ".ps_resub_pkt_eop_err_enable: 0x" << int_var__ps_resub_pkt_eop_err_enable << dec << endl);
    PLOG_MSG(hex << string(get_hier_path()) << ".ps_resub_phv_err_enable: 0x" << int_var__ps_resub_phv_err_enable << dec << endl);
    PLOG_MSG(hex << string(get_hier_path()) << ".ps_resub_phv_sop_err_enable: 0x" << int_var__ps_resub_phv_sop_err_enable << dec << endl);
    PLOG_MSG(hex << string(get_hier_path()) << ".ps_resub_phv_eop_err_enable: 0x" << int_var__ps_resub_phv_eop_err_enable << dec << endl);
    PLOG_MSG(hex << string(get_hier_path()) << ".ma_err_enable: 0x" << int_var__ma_err_enable << dec << endl);
    PLOG_MSG(hex << string(get_hier_path()) << ".ma_sop_err_enable: 0x" << int_var__ma_sop_err_enable << dec << endl);
    PLOG_MSG(hex << string(get_hier_path()) << ".ma_eop_err_enable: 0x" << int_var__ma_eop_err_enable << dec << endl);
}
#endif // CSR_NO_SHOW_IMPL

